import Chart from "react-apexcharts";

export const PopulationChart = (props) => {
  const state = {
    series: [
      {
        name: "Desktops",
        data: props.data,
      },
    ],
    options: {
      chart: {
        height: 400,
        width: 250,
        type: "area",
        zoom: {
          enabled: false,
        },
      },

      dataLabels: {
        enabled: false,
      },
      stroke: {
        width: 1,
        curve: "straight",
      },
      title: {
        text: "Population",
        align: "left",
      },
      grid: {
        row: {
          colors: ["#f3f3f3", "transparent"], // takes an array which will be repeated on columns
          opacity: 0.5,
        },
      },
      yaxis: {
        show: false,
      },
      xaxis: {
        labels: {
          show: false,
        },
      },
    },
  };

  return (
    <Chart
      options={state.options}
      series={state.series}
      style={{ padding: 0 }}
    />
  );
};
